import React from "react";

import { Message } from "components";

import "./Chat.scss";

const Chat = ({ messages }) => {
  console.log(messages);
  return (
    <div className="chat__cnt">
      <div className="chat__cnt--messages">
        {messages &&
          messages.map(item => (
            <Message
              text={item.text}
              date={item.date}
              isMe={item.author === "1"}
            />
          ))}
      </div>
    </div>
  );
};

export default Chat;
